    const handleItemClick=(e,{name})=>
       {
            console.log("click");
            setActiveItem(name);
        }



    return (
        <div>

<Menu tabular>
        <Menu.Item
          name='bio'
          active={activeItem === 'bio'}
          onClick={handleItemClick}
        />
        <Menu.Item
          name='photos'
          active={activeItem === 'photos'}
          onClick={handleItemClick}
        />
      </Menu>
            {children}



        </div>
    )

};

AppLayout.propTypes = {


    children: propTypes.node.isRequired,
}
